import React from 'react';
import Nav from './Nav';
import './CSS/Home.css'

export default class Home extends React.Component{
    render(){
        return(
            <div className="home-container">
                <Nav/>
                <div className="img-tray">
                    <img src="" alt=""></img>
                </div>
            </div>
        );
    }
}
